applicationInfo:
- Các tập đoàn kinh tế, tổng công ty thành lập trước thời điểm Nghị định này có hiệu lực thi hành:
(*) Đáp ứng các tiêu chí thành lập tập đoàn kinh tế, tổng công ty trừ tiêu chí về vốn điều lệ quy định tại Điều 9 Nghị định này, trong thời hạn ba (03) năm kể từ ngày Nghị định này có hiệu lực thi hành phải bổ sung đủ số vốn điều lệ theo quy định của Nghị định này. Trường hợp không được bổ sung vốn điều lệ, sau thời hạn trên sẽ phải thực hiện ngay việc chuyển đổi thành tổng công ty hoặc nhóm công ty tương ứng với các điều kiện thực tế của doanh nghiệp;
(*) Không đáp ứng các điều kiện thành lập quy định tại Nghị định này, sẽ phải tiến hành chuyển đổi thành tổng công ty hoặc nhóm công ty tương ứng với các điều kiện thực tế của doanh nghiệp trong thời hạn hai (02) năm kể từ ngày Nghị định có hiệu lực thi hành;
(*) Có nhiều hơn ba (03) cấp doanh nghiệp thì trong thời hạn hai (02) năm kể từ ngày Nghị định này có hiệu lực thi hành phải tổ chức lại, sắp xếp các công ty con của doanh nghiệp cấp III hiện có. Cơ quan đại diện chủ sở hữu có trách nhiệm theo dõi, giám sát quá trình tổ chức lại, sắp xếp của các tập đoàn kinh tế, tổng công ty này.
- Các công ty mẹ trong tập đoàn kinh tế, tổng công ty có số lượng Kiểm soát viên, thành viên Hội đồng thành viên, Phó Tổng Giám đốc chưa phù hợp với quy định tại Nghị định này thì phải tiến hành bổ sung hoặc điều chuyển trong thời hạn một (01) năm kể từ ngày Nghị định có hiệu lực thi hành.
- Các tập đoàn kinh tế, tổng công ty không thuộc đối tượng áp dụng của Nghị định này có thể vận dụng các quy định có liên quan của Nghị định này để tổ chức và hoạt động.
